import './App.css';
import {Routes, Route} from "react-router-dom"
import Home from "./Home/Home"
import logement from './logement/logement';

function App() {
  return (
    <div className="app">
      <Routes>
        <Route path="/" element={<Home/>}/>
        <route path="/logement" element={<Home/>}/>
      </Routes>
    </div>
  );
}

export default App;
